/**
 * GLM-4.5 Orchestrator API Endpoint
 *
 * This endpoint demonstrates the GLM SDK as the primary orchestrator
 * for the OptiMind AI Ecosystem, providing centralized coordination
 * of all AI agents and system components.
 */

import { NextRequest, NextResponse } from 'next/server';
import { glmOrchestrator } from '@/lib/glm-orchestrator';

export async function GET(request: NextRequest) {
  try {
    const { searchParams } = new URL(request.url);
    const action = searchParams.get('action') || 'status';

    // Initialize orchestrator if not already initialized
    if (!glmOrchestrator.getStatus().isInitialized) {
      await glmOrchestrator.initialize();
    }

    switch (action) {
      case 'health':
        const healthStatus = await glmOrchestrator.analyzeSystemHealth();
        return NextResponse.json({
          success: true,
          action: 'health-analysis',
          orchestrator: 'GLM-4.5',
          data: healthStatus,
          timestamp: new Date().toISOString(),
        });

      case 'status':
        const status = glmOrchestrator.getStatus();
        return NextResponse.json({
          success: true,
          action: 'status',
          orchestrator: 'GLM-4.5',
          data: status,
          timestamp: new Date().toISOString(),
        });

      case 'test-analysis':
        const analysisOperation = {
          type: 'analysis' as const,
          priority: 'high' as const,
          payload: {
            target: 'system-performance',
            metrics: ['response-time', 'throughput', 'error-rate'],
          },
          agentRequirements: ['glm-4.5-flagship', 'glm-4.5-auto-think'],
          expectedOutcome: 'performance-analysis-report',
        };

        const analysisId = await glmOrchestrator.submitOperation(analysisOperation);
        const analysisResult = await glmOrchestrator.getOperationResult(analysisId);

        return NextResponse.json({
          success: true,
          action: 'test-analysis',
          orchestrator: 'GLM-4.5',
          operationId: analysisId,
          data: analysisResult,
          timestamp: new Date().toISOString(),
        });

      case 'test-optimization':
        const optimizationOperation = {
          type: 'optimization' as const,
          priority: 'medium' as const,
          payload: {
            target: 'resource-allocation',
            parameters: ['cpu', 'memory', 'network'],
          },
          agentRequirements: ['glm-4.5-full-stack'],
          expectedOutcome: 'optimized-resource-allocation',
        };

        const optimizationId = await glmOrchestrator.submitOperation(optimizationOperation);
        const optimizationResult = await glmOrchestrator.getOperationResult(optimizationId);

        return NextResponse.json({
          success: true,
          action: 'test-optimization',
          orchestrator: 'GLM-4.5',
          operationId: optimizationId,
          data: optimizationResult,
          timestamp: new Date().toISOString(),
        });

      case 'test-prediction':
        const predictionOperation = {
          type: 'prediction' as const,
          priority: 'high' as const,
          payload: {
            task: 'system-behavior-prediction',
            timeframe: 'next-30-days',
            metrics: ['performance', 'security', 'scalability'],
          },
          agentRequirements: ['glm-4.5-flagship', 'glm-4.5-auto-think'],
          expectedOutcome: 'predictive-analysis-report',
        };

        const predictionId = await glmOrchestrator.submitOperation(predictionOperation);
        const predictionResult = await glmOrchestrator.getOperationResult(predictionId);

        return NextResponse.json({
          success: true,
          action: 'test-prediction',
          orchestrator: 'GLM-4.5',
          operationId: predictionId,
          data: predictionResult,
          timestamp: new Date().toISOString(),
        });

      default:
        return NextResponse.json(
          {
            success: false,
            error: 'Unknown action',
            availableActions: [
              'health',
              'status',
              'test-analysis',
              'test-optimization',
              'test-prediction',
            ],
            timestamp: new Date().toISOString(),
          },
          { status: 400 }
        );
    }
  } catch (error) {
    console.error('GLM Orchestrator API Error:', error);
    return NextResponse.json(
      {
        success: false,
        error: error instanceof Error ? error.message : 'Unknown error',
        orchestrator: 'GLM-4.5',
        timestamp: new Date().toISOString(),
      },
      { status: 500 }
    );
  }
}

export async function POST(request: NextRequest) {
  try {
    const body = await request.json();
    const { action, payload } = body;

    // Initialize orchestrator if not already initialized
    if (!glmOrchestrator.getStatus().isInitialized) {
      await glmOrchestrator.initialize();
    }

    switch (action) {
      case 'submit-operation':
        const operation = {
          type: payload.type || 'analysis',
          priority: payload.priority || 'medium',
          payload: payload.data || {},
          agentRequirements: payload.agentRequirements || ['glm-4.5-flagship'],
          expectedOutcome: payload.expectedOutcome || 'operation-completion',
        };

        const operationId = await glmOrchestrator.submitOperation(operation);

        return NextResponse.json({
          success: true,
          action: 'submit-operation',
          orchestrator: 'GLM-4.5',
          operationId,
          message: 'Operation submitted successfully',
          timestamp: new Date().toISOString(),
        });

      case 'get-result':
        if (!payload.operationId) {
          return NextResponse.json(
            {
              success: false,
              error: 'Operation ID is required',
              timestamp: new Date().toISOString(),
            },
            { status: 400 }
          );
        }

        const result = await glmOrchestrator.getOperationResult(payload.operationId);

        return NextResponse.json({
          success: true,
          action: 'get-result',
          orchestrator: 'GLM-4.5',
          operationId: payload.operationId,
          data: result,
          timestamp: new Date().toISOString(),
        });

      case 'comprehensive-test':
        // Import and run the comprehensive test
        const { glmOrchestratorTest } = await import('@/lib/glm-orchestrator-test');
        const testReport = await glmOrchestratorTest.runComprehensiveTest();

        return NextResponse.json({
          success: true,
          action: 'comprehensive-test',
          orchestrator: 'GLM-4.5',
          data: testReport,
          timestamp: new Date().toISOString(),
        });

      default:
        return NextResponse.json(
          {
            success: false,
            error: 'Unknown action',
            availableActions: ['submit-operation', 'get-result', 'comprehensive-test'],
            timestamp: new Date().toISOString(),
          },
          { status: 400 }
        );
    }
  } catch (error) {
    console.error('GLM Orchestrator API Error:', error);
    return NextResponse.json(
      {
        success: false,
        error: error instanceof Error ? error.message : 'Unknown error',
        orchestrator: 'GLM-4.5',
        timestamp: new Date().toISOString(),
      },
      { status: 500 }
    );
  }
}

import { NextResponse } from 'next/server';

export async function GET() {
  const startTime = Date.now();
  const healthStatus = {
    status: 'healthy',
    timestamp: new Date().toISOString(),
    uptime: process.uptime,
    memory: process.memoryUsage(),
    version: process.version,
    platform: process.platform,
    arch: process.arch,
    nodeEnv: process.env.NODE_ENV,
  };

  // Check database connection (quick check)
  try {
    const { PrismaClient } = require('@prisma/client');
    const prisma = new PrismaClient();
    await prisma.$queryRaw`SELECT 1`.catch(() => {});
    await prisma.$disconnect();
    healthStatus.database = 'connected';
  } catch (error) {
    healthStatus.database = 'disconnected';
  }

  // Check critical services
  healthStatus.services = {
    api: 'operational',
    database: healthStatus.database === 'connected' ? 'operational' : 'degraded',
    auth: 'operational',
    fileSystem: 'operational',
  };

  // Calculate response time
  const responseTime = Date.now() - startTime;
  healthStatus.responseTime = `${responseTime}ms`;

  // Determine overall health
  const isHealthy = healthStatus.database === 'connected' && responseTime < 5000;
  healthStatus.status = isHealthy ? 'healthy' : 'degraded';

  return NextResponse.json(healthStatus, {
    status: isHealthy ? 200 : 503,
    headers: {
      'Cache-Control': 'no-cache',
      'X-Response-Time': `${responseTime}ms`,
    },
  });
}

import { NextResponse } from 'next/server';

// Health status constants
const HEALTH_STATUS = {
  HEALTHY: 'healthy' as const,
  DEGRADED: 'degraded' as const,
  UNHEALTHY: 'unhealthy' as const,
} as const;

// Health thresholds
const HEALTH_THRESHOLDS = {
  UPTIME_TARGET: 99.9,
  MAX_RESPONSE_TIME: 100,
  WARNING_CPU_THRESHOLD: 70,
  WARNING_MEMORY_THRESHOLD: 80,
  WARNING_DISK_THRESHOLD: 85,
} as const;

interface ServiceHealth {
  database: string;
  aiModels: string;
  api: string;
  storage: string;
}

interface SystemMetrics {
  cpu: number;
  memory: number;
  disk: number;
  network: number;
}

interface HealthAlert {
  id: string;
  type: string;
  title: string;
  description: string;
  timestamp: string;
}

interface HealthData {
  status: string;
  timestamp: string;
  uptime: string;
  responseTime: number;
  services: ServiceHealth;
  alerts: HealthAlert[];
  metrics: SystemMetrics;
  version: string;
  environment: string;
}

/**
 * Creates default health alerts for the system
 */
function createHealthAlerts(): HealthAlert[] {
  return [
    {
      id: '1',
      type: 'success',
      title: 'System Performance Optimized',
      description: 'All systems are running at peak efficiency',
      timestamp: '5 minutes ago',
    },
    {
      id: '2',
      type: 'info',
      title: 'New Features Available',
      description: 'Check out the latest AI optimization tools',
      timestamp: '1 hour ago',
    },
    {
      id: '3',
      type: 'warning',
      title: 'API Rate Limit Approaching',
      description: 'Consider upgrading your plan for higher limits',
      timestamp: '3 hours ago',
    },
  ];
}

/**
 * Generates system metrics with default values
 */
function generateSystemMetrics(): SystemMetrics {
  return {
    cpu: 45,
    memory: 62,
    disk: 78,
    network: 34,
  };
}

/**
 * Creates service health status object
 */
function createServiceHealth(): ServiceHealth {
  return {
    database: HEALTH_STATUS.HEALTHY,
    aiModels: HEALTH_STATUS.HEALTHY,
    api: HEALTH_STATUS.HEALTHY,
    storage: HEALTH_STATUS.HEALTHY,
  };
}

/**
 * Builds comprehensive health data object
 */
function buildHealthData(): HealthData {
  return {
    status: HEALTH_STATUS.HEALTHY,
    timestamp: new Date().toISOString(),
    uptime: `${HEALTH_THRESHOLDS.UPTIME_TARGET}%`,
    responseTime: 98,
    services: createServiceHealth(),
    alerts: createHealthAlerts(),
    metrics: generateSystemMetrics(),
    version: '1.0.0',
    environment: process.env.NODE_ENV || 'development',
  };
}

/**
 * Handles health check errors with proper response
 */
function handleHealthError(error: unknown): NextResponse {
  console.error('Error fetching health data:', error);
  return NextResponse.json({ error: 'Failed to fetch health data' }, { status: 500 });
}

export async function GET(): Promise<NextResponse> {
  try {
    const healthData = buildHealthData();
    return NextResponse.json(healthData);
  } catch (error) {
    return handleHealthError(error);
  }
}

