      const data = await response.json();
      if (data.success) {
        setResults(prev => [...prev, ...data.data.orchestratedOperations]);
        await fetchStatus();
        await fetchHealth();
      } else {
        setError(data.error);
      }
    } catch (err) {
      setError('Failed to run comprehensive test');
    } finally {
      setLoading(false);
    }
  };

