                                    <Badge variant="outline" className="text-xs">
                                      {issue.component}
                                    </Badge>
                                    <Badge
                                      className={`${getSeverityColor(issue.severity)} text-white text-xs`}
                                    >
                                      {issue.severity.toUpperCase()}
